import Header from "../Header";
import Category from "../Category"
import About from "../About"
import Event from "../Event";
import Loading from "../Loading/Loading";

function HomeScreen(){
    const [loading, setLoading] = useState(false)
        if (loading) {
            return (
            <Loading />
            )
        }

    return(
        <>
            <Header/>
            <Category/>
            <Event/>
            <About/>
        </>
    )
}

export default HomeScreen
